At Love Wellness we want to talk about and bring awareness to this week's shooting in Atlanta, as well as other acts of racially motivated violence in cities across the US against the AAPI community. 68% of these attacks target women, and there has been a 1900%* increase in violence against the AAPI community in the last year. We're calling on the media to re-frame the conversation around these attacks and to call them what they are: hate crimes against Asian Americans and Pacific Islanders. Reducing the women who were killed in this attack to mere "massage parlor" workers is an unacceptable trivialization and victim shaming that must be addressed. After all that has happened over the course of the past year we can all do more and do better.
⠀
At @lovewellness we are talking about and bringing awareness to this violence because as a brand we are committed to our mission of support, equality, love and education. We are a part of the AAPI community; we reject racism and encourage you all to be anti-racist allies to our AAPI community.
⠀
