Hi, I’m Lauren, the founder and CEO of Love Wellness, an American made brand, and I am a US citizen.

All citizens have an unspoken responsibility to take care of oneself and each other, but I recognize that as a white individual with a public platform and business, it is important that I use the tools at my disposal for good, for education, for love, and for empathy.

It’s important during this time to recognize that silence is no longer acceptable. It is time to take action: through conversations, by educating ourselves about institutionalized racism here in the United States, by peacefully protesting, by being an active anti-racist voice and leader in our community, and by making contributions to groups working hard to make equality for all people a reality. It is not the responsibility of black and brown people to teach others how to be better. It’s on us.

At Love Wellness, our mission has always been and will be rooted in positivity, peace, and equality. Please join us today as we donate to and support the NAACP, the largest grassroots civil rights organization here in the United States. Thank you for listening. We will no longer remain silent. Black lives matter. Thank you.

#Blacklivesmatter 
